import "./App.css";
import Header from "./components/Header.js";
import InputField from "./components/InputField.js";
import BodyPanel from "./components/BodyPanel.js";

function App() {
  return (
    <div className="App">
      <Header />
      <InputField />
      <BodyPanel></BodyPanel>
    </div>
  );
}

export default App;
